import { describe, beforeAll, afterAll, test, expect } from '@jest/globals';
import axios from 'axios';

describe('Movies API Tests', () => {
    const baseURL = 'http://localhost:3000/movie'; // Backend corriendo en Docker

    test('should fetch top 10 movies', async () => {
        const response = await axios.get('http://localhost:3000/movie/top10');
        expect(response.status).toBe(200);
        expect(response.data).toEqual([
            {
        "title": "Movie 4",
        "premiereDate": "2023-11-20T00:00:00.000Z",
        "genres": [
          "Genre 4"
        ],
        "directors": [
          "Director 4"
        ],
        "image": "data:image/jpeg;base64,"}

    ]);
    });
});